                                <div>{item.rating !== false ? item.rating : null}</div>
                                <div>{item.ranking_data.ranking_string ? item.ranking_data.ranking_string : null}</div>
                                <div>{item.price_level !== false ? item.price_level : null}</div>
                             </> 
